import axios from "axios"
import { useEffect, useState } from "react";

const View = () =>{
    const [Data,SetData] = useState([])
    const fetchProduct = async() =>{
        response = await axios.get("http://localhost:5000/view/view_product");
        SetData(res.data)
    }
    useEffect(()=>{
        fetchProduct()
    },[])
        
    return(
        <>
        <table>
            <tr><th>Title</th><th>Category</th><th>Sub Category</th><th>Abstract</th><th>Files</th><th>Video</th></tr>
            {Data.map((prouct)=>{
                <tr key={prouct._id}><td>{prouct.title}</td>
                <td>{prouct.title}</td>
                <td>{prouct.category}</td>
                <td>{prouct.subcategory}</td>
                <td>{prouct.description}</td>
                <td>{prouct.video}</td>                
                </tr>
            })}
        </table>
        </>
    )
}
export default View;
